import "..//App.css";

import "./header.css";
import React from "react";


const Header = () => {
  return (
      <header>
        <div className="container">
        <div className="header__inner">
        <div className="main">
          <ol>
            <li>Students</li>
            <li>Employers</li>
          </ol>
        </div>
        <div className="auth"></div>
        <ol>
          <li>
            <a href="#">Log In</a>
          </li>
          <li>
            <a href="#">Sign Up</a>
          </li>
        </ol>
        </div>
        </div>
      </header>
  );
};

export default Header;
